function Navigation(){
    return(
<nav>
<div className="navbar">
  <ul>
    <li>Home</li>
    <li>About</li>
    <li>Experience</li>
    <li>Works</li>
    <li>Contacts</li>
  </ul>
</div>
</nav>);
}
export default Navigation
